import React from 'react';

const Common = () =>{
    return(
        <>
        <div className="section">
            <h1>Grow Your businesses with</h1><br />
            <h1><span>React Application</span></h1>
            <br></br>
            <p>We are the team of talented developers</p>
        </div>
        </>
    )
}

export default Common;
